import React from 'react';

function App() {
  const name="아기사자";
  const age=23;

  return (
    <div style={{
      padding:'50px',
      fontFamily: 'Pretendard, sans-serif',
      borderRadius: '12px',
      maxWidth:'600px',
      margin: '40px auto',
      boxShadow:'0 8px 16px rgba(0, 0, 0, 0.1)',
      textAlign:'center' 
    }}>
   <h1 style={{ color:'#ee9014', marginBotton:'20px'}}>
    안녕하세요, 저는 {name}입니다!
   </h1>
   <p style={{fontSize:'18px',color:'#555'}}> 
    저는 나이는 {age}살이며, 프론트엔드 개발자를 꿈꾸고 있습니다. 
   </p>
   </div>
  );
}

export default App;
